import React from 'react';
import { Link } from 'react-router-dom';

const ItemList = props => {
  return (
    <div className='col s6 m6 l4 '>
      <div
        className={
          props.item.Avail >= 10
            ? 'card hoverable waves-effect waves-block waves-red'
            : props.item.Avail === 0
            ? 'card waves-effect waves-block waves-grey grey lighten-1'
            : 'card hoverable waves-effect waves-block waves-red red lighten-4'
        }
      >
        <Link to={{ pathname: '/edit', state: props.item }}>
          <span
            className='right truncate'
            style={{ marginRight: 10, fontSize: 20 }}
          >
            {props.item.Avail}
          </span>
        </Link>
        <div
          className='card-content'
          style={{ cursor: 'pointer' }}
          onClick={props.add}
          id={props.item.Name}
        >
          <span className='card-title' onClick={props.add} id={props.item.Name}>
            {props.item.Name}
          </span>
          <div className='right' onClick={props.add} id={props.item.Name}>
            Price : {props.item.Price}
          </div>
        </div>
      </div>
    </div>
  );
};
export default ItemList;
